(1897,179,"jumbotron_left_title","<h5 class=\"h6\">How much does it cost?</h5>\r\nWe have no setup or application fees. We only charge a flat fee of $0.69 per thousand per day. That’s cheap!!\r\n<h5 class=\"h6\">Are there any hidden fees?</h5>\r\nNO! Just the advance fee of $0.69 per thousand per day from the start until 10 days after the closing date.\r\n<h5 class=\"h6\">How long does it take?</h5>\r\nVery fast!! Most people are approved in under 1 hour, and the funds are sent out immediately after approval. Customers generally receive the money in their bank account same-day, or the following morning.\r\n<h5 class=\"h6\">More questions?</h5>"),
